function socialMedia() {
  return (
    <div className='irancell-social-media-wrapper mt-[12%]'>
        <svg height="19px" viewBox="0 0 1366 19.18" preserveAspectRatio="none" className="mtn-curve">
            <path d="M683.1,18.3C386.63,18.3,129.24,10.85,0,0V19.18H1366V0C1236.66,10.84,979.37,18.3,683.1,18.3Z" class="mtn-svg-fill--gray"></path>
        </svg>
        socialMedia
    </div>
  )
}

export default socialMedia
